import React from 'react'
import { Link } from 'react-router-dom'
import outreachImg from '../assets/outreach.png'
import writingImg from '../assets/writing.png'
import researchImg from '../assets/research.png'


const writing = {
  backgroundImage: `url(${writingImg})`,
  height: '500px',
}
const outreacClass = {
  backgroundImage: `url(${outreachImg})`
}
const researcClass = {
  backgroundImage: `url(${researchImg})`
}


export default function WhatIDo() {

  const iDoArr = ['writing', 'research', 'outreach']
  const iDo = iDoArr.map(thing => {
    return (
      <section style={writingClass}>
        <div>
          <h3>{thing}</h3>
          <Link to='/writing'>
            <button>Go to</button>
          </Link>
        </div>
      </section>
    )
  })

  return (
    <div>
      {iDo}
    </div>
  )
}
